import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return(
  <nav className="navbar navbar-dark">

    <Link className="nav-link text-uppercase" to={'/'}>Home</Link>
  </nav>
  )
}

export default NavBar;
